export default function Login() {
    return(
        <React.Fragment>
        <main className="container">
            <div className="form">
                <h1 className="title">LOGIN</h1>
                <form>
                    <input type="text" placeholder="Digite seu email..."></input>
                    <input type="password" placeholder="Digite sua senha..."></input>
                </form>
            </div>

        </main>
        </React.Fragment>
        
    );
}
